  //     document.body.style.backgroundColor = 'black';
  //   }
  // else{
  //   setMode('light');
  //   document.body.style.backgroundColor = 'white';
  // }
  // }
  return (
    <>
      <Router>
        <Routes>
          <Route path="/">
            <Navbar />
            <Slider />
            <Form />
            <Footer />
          </Route>
          <Route path="/login" >
      <Login/>
        </Route>
      </Routes>
    </Router >
    </>
  );
}

export default App;
